import React from "react";
import Header from "./Header";

export default function Todo() {
  return (
    <>
        <Header forlabel = "title" inputlabel = "Title" inputtype = "text" />
        <Header forlabel = "description" inputlabel = "Description" inputtype = "text-area" />
        <button type="button" class="btn btn-info">Warning</button>
    </>
  );
}
